        </div>
        <div>
          <input placeholder={"password"} type="text" />
        </div>
        <div>
          <input type={"checkbox"} /> remember me
        </div>
        <div>
          <button>sing in</button>
        </div>
      </form>
    </div>
  );
};

const LoginForm = () => {
    return (
      
        <form>
          <div>
            <input placeholder={"login"} type="text" />
          </div>
          <div>
            <input placeholder={"password"} type="text" />
          </div>
          <div>
            <input type={"checkbox"} /> remember me
          </div>
          <div>
            <button>sing in</button>
          </div>
        </form>
      
    );
  };

export default Login;
